import React from "react";

const haitamPhone1Id = document.getElementById("haitamPhone1-id");
const haitamPhone2Id = document.getElementById("haitamPhone2-id");
const haitamPhone3Id = document.getElementById("haitamPhone3-id");
const haitamPhone4Id = document.getElementById("haitamPhone4-id");

const haitamPhone = "";
if (haitamPhone === "") {
  haitamPhone1Id.remove();
  haitamPhone2Id.remove();
  haitamPhone3Id.remove();
  haitamPhone4Id.remove();
}

function Card(props) {
  return (
    <div className="card bg-dark text-white">
      <img src="./images/haitam.jpg" className="card-img-top" alt="" />
      <div className="card-body">
        <h5 className="card-title text-center fs-2">Haitam SKHAIRI</h5>
        <p className="card-text text-center fs-5">Website Designer</p>
        <div className="info fs-6 mt-4">
          <p id={props.id}>Phone: {haitamPhone}</p>
          <p>Email: haitam.skhairi@gmail.com</p>
          <p>Website: haitamskhairi.com</p>
        </div>
      </div>
    </div>
  );
}

export default Card;
